import React from 'react';

const Recipe = ({title, url, image}) => {

  return (
    <div className="card">
      <div>{title}</div>
      <p><a href={url}>Find out more</a></p>
      <img src={image} alt="" />
    </div>
  );

}

export default Recipe;
